"use strict";Vue.component("v-title",{template:'\n  <div class="v-title" :class="{\'bordered\':border}" :style="titleStyle">\n    <div class="title-inner" :style="labelStyle">\n      <slot></slot>\n      <span v-if="number">(<i style="font-style: normal;color:#409def;">{{ number }}</i>)</span>\n      <span v-if="line===\'left\'" class="line-left"></span>\n      <span v-if="line===\'bottom\'" class="line-bottom"></span>\n    </div>\n  </div>',props:{bold:Boolean,border:Boolean,fontSize:{type:String,default:"18px"},line:{type:String,default:"none"},bottom:String,number:Number},computed:{titleStyle:function(){var t={};return this.bottom&&(t={marginBottom:this.bottom}),t},labelStyle:function(){return{padding:"15px 5px 15px ".concat("left"===this.line?"20px":"5px"),fontWeight:this.bold?"bold":"normal",fontSize:this.fontSize}}}});